import React from 'react';
import { Card, Container } from 'react-bootstrap';

const Main = () => {
    const dummy = {
        lastBook: {
            title: '위대한 게츠비',
            author: 'F. 스콧 피츠제럴드',
            image: 'http://minumsa.minumsa.com/wp-content/uploads/bookcover/075_위대한개츠비-300x511.jpg',
            progress: 25,
        },
    };

    return (
        <Container>
            <div className='row'>
                <div className='col-6'>
                    <Card>
                        <Card.Body>
                            <h3>마지막으로 읽은 책</h3>

                            <div className='row mt-3'>
                                <div className='col-4'>
                                    <img
                                        src={dummy.lastBook.image}
                                        alt=''
                                        className='img-fluid rounded border'
                                    />
                                </div>

                                <div className='col-8'>
                                    {dummy.lastBook.title}
                                </div>
                            </div>
                        </Card.Body>
                    </Card>
                </div>

                <div className='col-6'>
                    <Card>
                        <Card.Body>
                            <h3>이번달 통계</h3>
                        </Card.Body>
                    </Card>
                </div>
            </div>
        </Container>
    );
};

export default Main;
